import logo from './logo.svg';
import './App.css';
import { useState } from 'react';

function Count(){
  const [count, setCount] = useState(0);

  const handleIncrement = () => {
    setCount(count + 1);};
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          This is my first react project
        </p>
        <a
          className="App-link"
          href="https://vpnsecurepro.com"
          target="_blank"
          rel="noopener noreferrer"
        >
          My website
        </a>

        <p>Count: {count}</p>
        <button type='button' onClick={() => setCount(handleIncrement) }></button>
      </header>
      </div>
  );
}

export default App;
